import React, { Component } from 'react';
import "animate.css/animate.min.css";

export default class Header extends Component {
    render() {
        return (
            <article className="Name" id="Home">
                <h1>CHRISTOPHE DEMEY</h1>
                <h2>MON PORTFOLIO</h2>
            </article>
        );
    }
}
